-- ----------------------------
-- Table structure for `trainline`
-- ----------------------------
DROP TABLE IF EXISTS `trainline`;
CREATE TABLE `trainline` (
  `provinceCode` varchar(255) NOT NULL,
  `province` varchar(255) NOT NULL,
  `cityCode` varchar(255) NOT NULL,
  `city` varchar(255) NOT NULL,
  `areaCode` varchar(255) DEFAULT NULL,
  `area` varchar(255) DEFAULT NULL,
  `trainLineName` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `lineLength` float DEFAULT NULL,
  `trainBoxNumber` float DEFAULT NULL,
  `useableTrainBoxNumber` float DEFAULT NULL,
  `dayCapacity` float DEFAULT NULL,
  `yearCapacity` float DEFAULT NULL,
  `yearShipments` float DEFAULT NULL,
  `contact` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `tel` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `valid` varchar(255) DEFAULT NULL,
  `expiryDate` varchar(255) DEFAULT NULL,
  `isDeleted` float DEFAULT NULL,
  `status` float DEFAULT NULL,
  `freeText` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `eId` varchar(255) DEFAULT NULL,
  `createrId` varchar(255) NOT NULL,
  `createdAt` varchar(255) NOT NULL,
  `updaterId` varchar(255) DEFAULT NULL,
  `updatedAt` varchar(255) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

